import React, { Component } from 'react';
import { withCookies } from 'react-cookie';
import { Head } from '../Head';
import './index.css'
const { browseRequest } = require('../matcha_pb');

class Feed extends Component {
	constructor(props) {
		super(props);

		this.state = {
			user: [{
				userID: 0,
				firstName: '',
			}]

		}
		this.readFeed = this.readFeed.bind(this)
	}

	readFeed = () => {
		console.log(`called`);
		const request = new browseRequest();
		const uid = this.props.cookies.get('uid');
		const temp = this.props.cookies.get('session_id');
		// request.setTagsList(['cat']);
		// request.setMaxage(20);
		const metaData = {
			'user_id': uid,
			'session_id': temp
		}
		const stream = window.Aclient.feed(request, metaData);
		stream.on('data', (response) => {
			console.log(response);
			this.setState({ user: {...this.state.user, uid: response.array[0], firstName: response.array[1]}})
			// this.setState(prevState => {
			// 	const newUser = [...prevState.user]
			// 	newUser[0] = {...newUser[0], userID: response.array[0]}
			// 	newUser[1] = {...newUser[0], firstName: response.array[0]}
			// 	// newUser[0] = 
			// 	// newUser[1] = response.array[1]
			// 	return { newUser }
			// })
			// console.log(this.state.user[)
			console.log(this.state.user)
			console.log(this.state.user[0].uid)
			console.log(this.state.user[0].firstName)

			// this.setState({ firstName: response.array[2] })
			// this.setState({ uid: response.array[0] })
		});
		stream.on('error', function(err) {
			console.log(`error: ${err}`);
		});
	}

	componentDidMount() {
		this.readFeed()
	}

	render() {
		return (
			<div>
				<Head />
				<div className="feedmain">
					Hello, {this.state.firstName} {this.state.uid}
				</div>
			</div>
		)
	}
}

export default withCookies(Feed);
